module.exports = {"attribute-attributes":"<p>&attributes接受一个对象作为参数，将该对象的每一个属性作为元素属性添加到元素中。</p>","attribute-boolean":"<p>对于布尔属性，出现即表示指定该属性，同时接受布尔值。当doctype不是html时，当结果是指定该属性时，该属性名会被自动添加为属性值。（这里只显示doctype为html是生成的HTML代码。）</p>","attribute-class":"<p>类属性可以是字符串、数组或者属性名为类名，属性值为布尔值的对象。Jade还支持同时指定多个类属性，它们会被合并到一起。</p>","attribute-shorthand":"<p>可以使用CSS形式指定类属性和ID。同时因为<code>div</code>是最常用的元素标签，所以在使用类或ID简写时，如果省略元素标签，将使用<code>div</code>。</p>","attribute-style":"<p>样式属性既可以使用字符串形式指定，也可以使用对象形式指定。</p>","attribute-unescaped":"<p>默认情况下，为了防止攻击，比如跨站脚本攻击，所有的标签属性值都是被转义的。如果某些字符不被转义，使用<code>!=</code>代替<code>=</code></p>","attributes":"<p>Jade标签属性在位于紧跟标签的圆括号中指定，属性值是<b>JavaScript表达式</b>。多个属性可以跨行。</p>","case":"<p>Jade中的<code>case</code>语句类似JavaScript中的<code>switch</code>语句，只是使用<code>case-when</code>而不是<code>switch-case</code>，同时不使用<code>break</code>。支持<code>fall through</code>和标签块扩展。</p>","code-buffered-unescaped":"<p>对缓冲的代码不进行转义。使用<code>!=</code>代替<code>=</code>即可。</p>","code-buffered":"<p>缓冲的代码即JavaScript表达式的值被计算后会被输出到编译后的HTML文件中的代码，以等号作为第一个非空白字符表示。也可以在元素标签后紧跟等号。支持任何JavaScript代码。处于安全考虑，结果都被转义。</p>","code-unbuffered":"<p>不缓冲的代码就是在编译后的HTML中不产生直接输出的JavaScript代码，以连字符作为第一个非空白字符表示。要实现跨行，只需要对后续行进行缩进即可。</p>","code":"<p>在Jade模板中，支持3种形式的JavaScript代码。</p>","comments-conditional":"<p>Jade没有为条件注释提供特别的语法，因为所有以<code><</code>开始的行都被当作纯文本看待，所以只需要使用正常的HTML条件注释就可以了。</p>","comments-general":"<p>Jade使用与JavaScript中相同的单行注释语法表示单行注释。当不希望某个注释被编译到HTML文件中时，在注释符后紧跟一个连字符（<code>-</code>）就可以了。当注释跨越多行时，只需要对后续行进行缩进就可以了。</p>","comments":"<p>Jade支持单行注释、块注释和条件注释。</p>","conditionals":"<p>Jade中可以通过<code>if</code>、<code>else if</code>、<code>else</code>和<code>unless</code>表示条件，用于标记代码的前导连接符（<code>-</code>）和条件表达式的括号都可以被省略。</p>","doctype":"<p>doctype字符串后跟实际的doctype，两者以空白字符隔开。Jade提供了很多doctype简写，同时支持自定义doctype。这里只以HTML5的doctype举例，关于doctype简写请参考<a href=\"http://jade-lang.com/reference/doctype/\">官方文档</a>。</p>","extends-inheritance":"<p>Jade提供了<code>extends</code>指令用于通过重写或改写预先定义的内容块扩充模板。\n  \n</p>\n<p>内容块通过<code>block</code>关键字，内容块名和可选的内容定义，内容块的内容即后续的缩进块。内容块中可以包含内容块。\n  \n</p>\n<p>在扩充模板过程中，既可以对其中的内容块进行替换，也可以给其中的内容块添加前置内容或者附加内容。替换内容通过定义一个同名内容块实现；添加前置内容或者附加内容通过定义前置块或者附加块实现。前置块通过<code>block prepend</code>定义，附加块通过<code>block append</code>定义。定义前置块和附加块时，<code>block</code>是可选的。</p>","filters":"<p>\n  过滤器使我们可以在Jade模板中使用其他语言，它们接受纯文本块作为输入。\n  \n</p>\n<p>所有的<a href=\"https://www.npmjs.com/browse/keyword/jstransformer\">JSTransformers</a>都可以用做Jade的过滤器，其中常用的有：<code>:coffee-script</code>, <code>:babel</code>, <code>:uglify-js</code>, <code>:less</code>和<code>:markdown-it</code>。</p>","includes":"<p>Jade提供了<code>include</code>指令用于在Jade文件中插入其他文件，包括Jade文件，纯文本和过滤器文件。</p>","interpolation-escape":"<p>任何在<code>#{}</code>中的JavaScript表达式都会被计算并且被相应的值替换，并且其中的特殊字符被转义。当某个元素的内容是某个JavaScript表达式时，可以使用简写形式：在元素标签后紧跟一个等号（<code>=</code>），然后是空白字符隔开的JavaScript表达式。</p>","interpolation-tag":"<p>当需要插入HTML元素时，只需要把元素标签声明放在<code></code>中即可，当然，也可以使用相应的HTML。</p>","interpolation-unescape":"<p>当需要JavaScript表达式的值中的特殊字符不被转义时，使用<code>!{}</code>替换<code>#{}</code>；而简写形式时<code>！=</code>替换<code>=</code>。</p>","interpolation":"<p>Jade提供了3种插值操作。</p>","iteration-each":"<p><code>each...in</code>可以用来对数组和对象进行迭代，默认情况下是对值进行迭代，这与<code>for...in</code>不同，而和ES6中的<code>for...of</code>相同；还可以通过指定第二个变量来获取数组索引或者对象属性名。被迭代的对象可以是数组或字面值，也可以是结果为数组或对象的任何JavaScript表达式。可以使用<code>for</code>作为<code>each</code>的别名。</p>","iteration-while":"<p><code>while</code>用于创建循环，和JavaScript中的<code>while</code>类似。</p>","iteration":"<p>Jade支持两种迭代：<code>each...in</code>和<code>while</code>，其中可以使用<code>for</code>作为<code>each</code>的别名。</p>","mixin-attributes":"<p>mixin会自动获取一个参数<code>attributes</code>，就像JavaScript中函数会自动获取<code>arugments</code>和<code>this</code>一样。<code>attributes</code>的值通过在正常调用mixin后跟一个圆括号，然后在其中指定属性。<code>attributes</code>的值默认被转义，如果要不被转义，需要使用<code>!=</code>代替<code>=</code>。也可以使用<code>&attributes</code>。</p>","mixin-block":"<p>mixin可以接受Jade块作为内容，Jade块就是紧跟在”调用“mixin后的一到多行缩进的Jade代码。</p>","mixin-rest":"<p>就和ES6中的剩余参数一样。</p>","mixins":"<p>mixin用于创建可重用的Jade块。mixin由mixin关键字，mixin名和一到多行Jade代码组成的mixin体组成。mixin可以接受参数，并且将被编译成函数。在使用时，在mixin名前添加加号（<code>+</code>）。</p>","plain-text-block":"<p>如果元素标签后紧跟英文句点，那么后面缩进的文本都会被当作这个元素内嵌的纯文本。</p>","plain-text-inline":"<p>在标签后以空白字符隔开的文本会被当作纯文本，即如果元素标签和文本之间只有空白字符，则文本被当作纯文本。</p>","plain-text-pipe":"<p>如果在文本前添加管道符，即<code>|</code>，那么这一行被当作纯文本。即如果某一行的第一个非空白字符是管道符，那么这一行就是纯文本。（管道文本必须单独占一行。）管道符和文本之间可以添加可选的空白字符。</p>","plain-text":"<p>Jade中有3种方式表示纯文本，分别用于不同的情景。</p>","tag-expansion":"<p>为了简洁，Jade提供了在一行内表示嵌套元素的语法：元素标签后紧跟冒号（<code>:</code>），然后是以空白字符隔开的嵌套元素。</p>","tag-self-close":"<p>HTML中所有的自关闭标签，比如<code>img</code>、<code>meta</code>等，都能被Jade识别并且自动关闭。另外，任何一个标签可以通过在末尾添加一个<code>/</code>显式地被关闭（只有在真正需要的时候这样做）。</p>","tags":"<p>默认情况下，一行中的第一个单词被当作HTML标签。HTML元素的嵌套关系使用缩进表示。</p>"};
